import React, { useEffect, useState } from "react";

const App = () => {
  const apiKey = "AIzaSyD_0oGw93lCcNaUkmdnEU780lDHOOnb-jI";
  const channelId = "@ukitivi";
  const [loading, setLoading] = useState(true);
  const [playlist, setPlaylist] = useState([]);

  useEffect(() => {
    fetch(
      `https://www.googleapis.com/youtube/v3/playlists?key=${apiKey}&id=${channelId}&part=snippet,status`
    )
      .then((response) => response.json())
      .then((response) => setPlaylist(response));
    setLoading(false);
  }, []);

  return (
    <div>
      {loading ? (
        <h1>loading...</h1>
      ) : (
        <div>
          {playlist.map((plist, index) => {
            <div key={index}>
              <ul>
                <li>{plist.items}</li>
              </ul>
            </div>;
          })}
        </div>
      )}
    </div>
  );
};
export default App;
